import React, { useState, useEffect } from 'react';

function GrabStocks({ vooStockAmount, googlStockAmount, pltrStockAmount }) {
  const [output, setOutput] = useState('');
  const [totalAmount, setTotalAmount] = useState(0); 

  const executePythonScript = async () => {
    const pythonScript = '/Users/benitochall/Documents/personalDevelopment/100kStarting/networthProject/networth/backend/pullStocks/pullstockdata.py';
    // const args = 'arg1 arg2'; Doesn't take any args
    // Notes to futures self, I had to change the executable permissions of the pull stocks data
    // as well as make sure the path was correct

    try {
      const response = await fetch('http://localhost:3001/executePython', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ pythonScript }),
      });

      if (!response.ok) {
        throw new Error('Failed to execute Python script');
      }

      const data = await response.json();
      setOutput(data.output);
    } catch (error) {
      console.error(error);
      setOutput('Error occurred while executing Python script');
    }
  };
  useEffect(() => { executePythonScript(); });

  setTotalAmount = () => {
    const destruture = JSON.parse(output);
    const vooAmount = Number(destruture.VOO) * vooStockAmount;
    const googlAmount = Number(destruture.GOOGL) * googlStockAmount;
    const pltrAmount = Number(destruture.PLTR) * pltrStockAmount;
    return (vooAmount + googlAmount + pltrAmount);
  };
  // this makes the fuction autmatically run while the data is being pulle

  return (
    <div>
      <div>
        <h2>Output:</h2>
        <h3>
          Investment Evaluation:
          {totalAmount}
        </h3>
      </div>
    </div>
  );
}

GrabStocks.propTypes = {
  children: PropTypes.node.isRequired,
  leftText: PropTypes.string,
  rightText: PropTypes.string,
};

RedBox.defaultProps = {
  leftText: 'Net Worth',
  rightText: '$0',
};

export default GrabStocks;
